def could_be(original, another):
    original = original.split()
    another = another.split()
    return original == another or ''.join(original).casefold() == ''.join(another).casefold()

def could_be(original, another):
    another = another.split()
    for i in range(1 << len(another)):
        name = ' '.join([another[j] for j in range(len(another)) if (i & (1 << j)) > 0])
        if name == original:
            return True
    return False

def could_be(original, another):
    if not original or not another:
        return False
    original_parts = original.split()
    another_parts = another.split()
    for i, part in enumerate(another_parts):
        if i < len(original_parts) and part == original_parts[i]:
            continue
        else:
            return False
    return True

